import React from "react";
import Popup from "reactjs-popup";

const sendURLPopup = () => {
  return (
    <Popup
      className="pop-up"
      trigger={<button> Try your own Image</button>}
      position="up center"
    >
    <div>
      <div class="ui input">
        <h3>Try your own image</h3>
        <p>Send a direct link to a picture on the web</p>
        <input type="text" placeholder="Paste Url" />
      </div>
    </div>
    </Popup>
  );
}

export default sendURLPopup;
